lf leads this stellar group of outlaw rockabilly cats. Always a big draw - You\'ll feel as comfortable in a straw hat or a ripped summer dress. I\'d suggest both. Here at Tupelo the 1st Thursdays of every month. Maybe watch a spaghetti western beforehand..','','',''),(290,86,'2014-11-07 21:30:00','2014-11-08 01:30:00',NULL,NULL,0,'','','performer','Jinx Jones and the Kingtones - Legendary Rockabilly powerhouse Jinx Jones and the Kingtones will blow you away! Here at Tupelo the 1st Friday of every month.. Get your Jinx on.','','',''),(291,86,'2014-11-08 19:30:00','2014-11-08 20:30:00',NULL,NULL,0,'','','performer','Will Evans - Songwriter and one man band Will Evans takes to the stage to open for Hot Pocket. This is gonna be one heck of a night! ','','',''),(292,86,'2014-11-08 21:30:00','2014-11-09 01:00:00',NULL,NULL,0,'','','performer','Hot Pocket - Deep Soul, great horns and penetrating vocals. These guys are the real deal. Every 2nd Saturday here at Tupelo','','',''),(293,86,'2014-11-09 21:00:00','2014-11-10 01:00:00',NULL,NULL,0,'','','performer','Love Gangsters - The Love Gangsters - Heavy, groovy, jazzy. Exceptional.','','',''),(294,86,'2014-11-10 21:00:00','2014-11-11 01:00:00',NULL,NULL,0,'','','performer','North Beach Saints - They aren\'t really Saints, but you\'ll feel like you\'re in church regardless. Soul, blues and just plain old good roots. 2nd Monday of every month.','','',''),(295,86,'2014-11-12 21:00:00','2014-11-13 01:00:00',NULL,NULL,0,'','','performer','Singer, songwriter showcase with Jason Riemath','','',''),(296,86,'2014-11-13 21:00:00','2014-11-14 01:00:00',NULL,NULL,0,'','','performer','Hot Einstein - Dynamic, booty shakin\' rock and soul. No filler - All killer','','',''),(297,86,'2014-11-14 21:00:00','2014-11-15 01:00:00',NULL,NULL,0,'','','performer','Marshall Law - The legendary Sam Marshall leads this amazing trio which plays everything from Prince to ACDC. You can see them at Tupelo every 2nd Friday at Tupelo','','',''),(298,86,'2014-11-15 21:30:00','2014-11-16 01:30:00',NULL,NULL,0,'','','performer','Shantytown - \"Soul and Roll\" pretty much gets to the meat of it. Fronted by Teague Kernan, this 7 piece powerhouse band leaves everything on the stage and never disappoints. Here at Tupelo the 1st and 3rd Saturdays of every month! - Get here early, as they always pack the house!','','',''),(299,86,'2014-11-16 21:00:00','2014-11-17 01:00:00',NULL,NULL,0,'','','performer','West Nile Ramblers - Hands down, the best bluegrass we could find anywhere - You\'ll think your sipping on moonshine and sittin\' on a stump in the Smokey mountains. Fiddle, mandolin and accordion round out this absolutely killer band!','','',''),(300,86,'2014-11-17 19:00:00','2014-11-17 23:59:00',NULL,NULL,0,'','','performer','One Voice Fundraiser Blowout -  Live music guests include Robbie Schaeffer of Eddie from Ohio and Teague Kernan of Shantytown among others!','','',''),(301,86,'2014-11-20 21:30:00','2014-11-21 01:00:00',NULL,NULL,0,'','','performer','Ron Hacker - Delta blues, heavy on the slide guitar','','',''),(302,86,'2014-11-21 22:00:00','2014-11-21 23:00:00',NULL,NULL,0,'','','performer','Dynamic','','',''),(303,86,'2014-11-23 21:00:00','2014-11-24 01:00:00',NULL,NULL,0,'','','performer','Spuyten Duyvil (\"SPITE+en DIE+vil\"), on tour from Hudson Valley N.Y. crackles with spontaneity and barn burning energy blending rockin\' roots, country, Piedmont blues, and jug band rhythms with wood-smoke ballads, soaring vocal harmony and stellar songwriting. We are psyched to have them!','','',''),(304,86,'2014-11-24 21:00:00','2014-11-25 01:00:00',NULL,NULL,0,'','','performer','Bedrock Radio','','',''),(305,86,'2014-11-26 21:30:00','2014-11-27 01:00:00',NULL,NULL,0,'','','performer','Chicken Bass & Waffles','','',''),(306,86,'2014-11-28 21:30:00','2014-11-29 01:00:00',NULL,NULL,0,'','','performer','Hot Einstein - Shake your booty 70\'s grooves. We wouldn\'t have them back every 4th friday if they didn\'t kick ass..','','',''),